    <div>
      {[1, 2, 3, 4, 5].map((star) => {
        return (
          <span
            className='start'                                                                                                                                   
            style={{
              cursor: 'pointer',
              color: stars >= star ? 'gold' : 'gray',
              fontSize: `35px`,
